        "id": "gid://myomr/Speaker/135",
        "name": "Lothar Krause",
        "descriptionDe": "Lothar hat in den letzten 20 Jahren in unterschiedlichste Positionen im Management, Sales und Online-Marketing gearbeitet und war unter anderem bei Unternehmen wie eBay, zanox und zalando tätig. Seit dem Jahr 2018 berät er als Consultant Firmen bei strategischen Fragestellungen und ist als Business Angel und Investor aktiv.  Lothar unterstützt Firmen bei deren weltweiten Expansionsstrategie und hat für zahlreichen Firmen den Markteintritt nach Deutschland vorbereitet und umgesetzt.  Fachlich hat er die Entwicklung von Online-Marketing und Programmatic Advertising so gut mitverfolgt wie kaum ein anderer: Als Mitarbeiter der ersten Stunde hat er sociomantics weltweite Expansion und Produktentwicklung der Demand Side Plattform aus Berlin mitverantwortet. Lothar war bereits im Jahr 2010 auf der allerersten OMR als Speaker und Panelist dabei. Seine Erfahrungen gibt er regelmäßig auf Konferenzen, Messen und an Universitäten weiter",
