        "descriptionDe": "Michael Fritz ist Konzeptions-Aktivist und Mitbegründer des internationalen Netzwerkes Viva con Agua. Neben mehr als 15.000 Ehrenamtlichen und dem gemeinnützigen Verein, zählen die ausgegliederten Social Business Firmen Viva con Agua Mineralwasser, Goldeimer Komposttoiletten, Viva con Agua Arts sowie Viva con Agua-Vereine in Uganda, Österreich, den Niederlanden und der Schweiz dazu. Die Viva con Agua-Stiftung möchte perspektivisch insbesondere den interkulturellen Austausch sowie den internationalen Ausbau der Bewegung fördern.",
        "descriptionEn": "Michael Fritz is a concept activist and co-founder of the global network Viva con Agua. In addition to the 15,000 volunteers and the charitable organization, the Viva con Agua network consists of a social business entity, selling mineral water and portable composting toilets, Viva con Agua Arts, the Viva con Agua foundation, and Viva con Agua organizations in Uganda, Austria, the Netherlands and Switzerland. In 2006, Michael Fritz founded Viva con Agua together with friends; its core mission is to make potable water accessible to all. To date, Viva con Agua’s efforts have helped sustainably improve the living conditions of over 3 million individuals around the world.",
