        "id": "gid://myomr/Speaker/1523",
        "name": "Timo Bernsmann",
        "descriptionDe": "Seit über 15 Jahren bin ich im Online Marketing unterwegs. Und wenn ich eins gelernt habe in dieser Zeit: Du darfst nie aufhören dich weiterzuentwickeln. Bei Finch konnte ich dazu beitragen, ein Expertenteam durch monumentale Veränderungen in der Branche zu führen und Finch dabei zu helfen, mit dem rasanten Tempo des eCommerce und der digitalen Werbung Schritt zu halten. Wir generieren mit Finch 1,25 Milliarden Dollar an Umsatz mit und für unsere Kunden und verwalten circa 100 Millionen Adspend.  Als Host der OMR-Deep Dives Google Ads & Author des Google Ads Reports und Experte der OMR Academy habe ich außerdem die Möglichkeit, Branchenwissen weiterzugeben und wertvolles Echtzeit-Feedback von Marken aus der Branche zu erhalten.",
        "descriptionEn": "I’ve spent over 15 years working in digital advertising, and in that time, I’ve learned one thing: you never know it all. At Finch, I’ve been able to help steer a team of experts through monumental industry shifts and help Finch keep ahead of the lightning-quick pace of eCommerce and digital advertising. Generating $1.25B in client revenue annually. As a facilitator of the OMR-Deep Dives & Reports and the OMR Academy, I also get the chance to share industry knowledge and gain valuable, real-time feedback from brands in the industry. I’m always excited to chat about all things digital advertising (and about my second favorite topic - pizza).",
