        "id": "gid://myomr/Speaker/870",
        "name": "Silke Gladfeld",
        "descriptionDe": "Silke Gladfeld, Executive Director bei der Agentur TERRITORY, a Company of Bertelsmann, kennt als studierte Kommunikationswirtin alle Facetten der Kommunikation. Sie sammelte Erfahrungen mit unterschiedlichen Schwerpunkten. Vom Branchendienstleister über Lifestyle- und People-Zeitschriften und einer großen, regionalen Tageszeitung bis hin zu Jugendbüchern wo sie jeweils die Klaviatur Print und Digital spielte. Dabei war sie in unterschiedlichen Positionen in Redaktion, Verlagsleitung, Marketing und Vermarktung tätig. Sie hat neben Deutschland auch in Frankreich und Ungarn gearbeitet. Jede einzelne Station ihres beruflichen Lebens war und ist geprägt von den unterschiedlichen Facetten und Formen, Geschichten zu erzählen. Heute verantwortet sie das Kundengeschäft.                                                                                                                                                                                                                                         ",
