        "id": "gid://myomr/Speaker/2404",
        "name": "Adrian Pickshaus",
        "descriptionDe": "Adrian Pickshaus entwickelt Kommunikationskonzepte für Unternehmen. Als Kreativdirektor der Hamburger Agentur Territory berät er Marken bei ihrer Content-Strategie. Als Chefredakteur verantwortet er die DB Mobil, Deutschlands größtes Reisemagazin, für die Deutsche Bahn. Ebenso betreut er das Coffee-Table-Magazin MINI Insider für die Automarke MINI. Zuvor hat er fünf Jahre lang die Medien der Lufthansa als Chefredakteur geprägt, davor war er als Politikredakteur und Auslandsreporter für Bild am Sonntag in Berlin tätig. ",
        "descriptionEn": "Adrian Pickshaus crafts communication concepts for companies. As Creative Director at Hamburg-based agency Territory, he provides brands consulting services on their content strategy. Furthermore, Adrian is Editor-in-Chief of Germany's largest travel magazine DB Mobil and also oversees the coffee table magazine MINI Insider for automotive brand MINI. Previously he was instrumental in shaping media and communications for the Lufthansa Groups as Editor-in-Chief and was also a foreign correspondent for Germany daily Bild and German weekly Bild am Sonntag. ",
