        "id": "gid://myomr/Speaker/558",
        "name": "Florian Heinemann",
        "descriptionDe": "Florian Heinemann ist Founding Partner beim Berliner Frühphasen-Investor Project A, wo er für die Bereiche Marketing, CRM und Business Intelligence verantwortlich ist. Zuvor war er Geschäftsführer bei Rocket Internet (2007-2012) und maßgeblich am Aufbau von Zalando/Global Fashion Group und eDarling/Affinitas beteiligt.",
        "descriptionEn": "Florian Heinemann is a Founding Partner at Project A Ventures, where he is responsible for the areas of marketing, CRM, and business intelligence. With more than 800m USD assets under management, Project A invests in digital companies at an early stage all over Europe. In addition to capital, Project A provides portfolio companies with exclusive operational support by a team of 100 in-house experts including all areas across product, growth, data and people. Since 2012 Project A has invested in more than 100 companies, among them Trade Republic, Spryker, Kry, Sennder, WorldRemit/Zeps, LUQOM, Voi, and Casavo. Before co-founding Project A, Florian was Managing Director at Rocket Internet with the same areas of responsibility (2007-2012). During his time at Rocket, he was mainly involved at Zalando, Global Fashion Group, and Spark Networks (aka eDarling/Affinitas). Prior to Rocket, Florian was Co-Founder and Managing Director of JustBooks/AbeBooks being in charge of marketing and product (1999-2002, exit to Amazon in 2008). Then, he was co-heading the online marketing department of Jamba! and the online dating portal iLove (2003-2005, exit to Verisign). In 2006, he was Co-Founder of the online marketplace antibodies-online.com (exit to Broadoak).  Moreover, Florian has been an investor/business angel in more than 80 startups including Trivago (seed investor), Zalando (founding investor), Audibene (seed investor), Home24 (founding investor), CityDeal/Groupon (founding investor), Betreut.de/Care (seed investor), ClassPass (early stage investor), Mimi Hearing (early stage investor), Bitbond (seed investor), Lillydoo (early stage investor), and the Code University (seed stage investor).  Apart from his Project A-related board activities he sits on the supervisory boards of Koerber AG and Fressnapf and the digital advisory boards of Henkel and Oetker.",
