        "descriptionDe": "Der gebürtige Westfale hat sich nach einem Wirtschaftsstudium im Ruhrgebiet und Indonesien früh der Livekommunikation verschrieben - seit 17 Jahren als Managing Partner der Party Rent Group. Wer schon mal auf dem OMR-Festival war, ist unweigerlich mit einem seiner Produkte in Berührung gekommen. Denn ob Möbel, Messecounter, Küchentechnik oder TableTop - als exklusiver Ausstattungspartner der OMR ist die Party Rent Group mit mehr als 100.000 Einzelartikeln vor Ort. Christoph liebt aber nicht nur die logistische Herausforderungen der Superlative wie hier auf der OMR. Den Eventausstatter begeistert vor allem das Thema Design. Als Trendscout der europaweit aktiven Party Rent Group ist er aktiv in die Entwicklung des Portfolios involviert. ",
